def min_cost(cost, m, n):
    # initialize the minimum cost matrix
    min_cost = [[0 for x in range(n)] for x in range(m)]

    # initialize the first row and first column of the minimum cost matrix
    min_cost[0][0] = cost[0][0]
    for i in range(1, m):
        min_cost[i][0] = min_cost[i-1][0] + cost[i][0]
    for j in range(1, n):
        min_cost[0][j] = min_cost[0][j-1] + cost[0][j]

    # calculate the minimum cost for the remaining cells
    for i in range(1, m):
        for j in range(1, n):
            min_cost[i][j] = min(min_cost[i-1][j], min_cost[i][j-1]) + cost[i][j]

    # return the minimum cost to reach (m, n)
    return min_cost[m-1][n-1]

