import heapq
def heap_queue_largest(nums, n):
    # Create a min heap of size n
    min_heap = []
    for num in nums:
        if len(min_heap) < n:
            heapq.heappush(min_heap, num)
        else:
            # If the current number is greater than the smallest number in the heap, pop the smallest number and push the current number into the heap
            if num > min_heap[0]:
                heapq.heappop(min_heap)
                heapq.heappush(min_heap, num)

    # The min heap now contains the n largest numbers from the list
    return min_heap

