def count_ways(n):
    # If the board is of size 3 x 1, there is only one way to fill it.
    if n == 1:
        return 1

    # If the board is of size 3 x 2, there are two ways to fill it.
    if n == 2:
        return 2

    # Recursively calculate the number of ways to fill the board of size 3 x (n-1) and 3 x (n-2).
    return count_ways(n-1) + count_ways(n-2)

