    # Find all the distinct numbers that can be formed by multiplying the prime factors of L and R
    distinct_numbers = set()
    for i in range(len(prime_factors_L)):
        for j in range(len(prime_factors_R)):
            distinct_numbers.add(prime_factors_L[i] * prime_factors_R[j])

