def lps(str):
    """
    This function finds the longest palindromic subsequence in the given string.

    Args:
        str (str): The string to find the longest palindromic subsequence in.

    Returns:
        str: The longest palindromic subsequence in the given string.
    """

    # create a table to store the lengths of the longest palindromic subsequences for all substrings of the given string.
    n = len(str)
    dp = [[0 for _ in range(n)] for _ in range(n)]

    # fill the table in bottom-up manner.
    for i in range(n - 1, -1, -1):
        dp[i][i] = 1
        for j in range(i + 1, n):
            if str[i] == str[j]:
                dp[i][j] = dp[i + 1][j - 1] + 2
            else:
                dp[i][j] = max(dp[i + 1][j], dp[i][j - 1])

    # construct the longest palindromic subsequence from the table.
    i = 0
    j = n - 1
    lps = ""
    while i <= j:
        if str[i] == str[j]:
            lps += str[i]
            i += 1
            j -= 1
        elif dp[i + 1][j] > dp[i][j - 1]:
            i += 1
        else:
            j -= 1

    return lps

