def count_no_of_ways(n, k):
    # If n is 0 or 1, there is only one way to paint the fence.
    if n <= 1:
        return k

    # If n is 2, there are k + k^2 ways to paint the fence.
    if n == 2:
        return k + k * k

    # Initialize the dp array to store the number of ways to paint the fence for each post.
    dp = [0] * (n + 1)

    # Initialize the dp array for the first two posts.
    dp[1] = k
    dp[2] = k + k * k

    # Iterate over the remaining posts and calculate the number of ways to paint the fence.
    for i in range(3, n + 1):
        # The number of ways to paint the current post depends on the color of the previous two posts.
        if dp[i - 1] == dp[i - 2]:
            # If the previous two posts have the same color, then the current post can be painted in k - 1 colors.
            dp[i] = dp[i - 1] + (k - 1) * dp[i - 2]
        else:
            # If the previous two posts have different colors, then the current post can be painted in k colors.
            dp[i] = dp[i - 1] + k * dp[i - 2]

    # Return the number of ways to paint the fence.
    return dp[n]

