def count_binary_seq(n):
    # initialize dp table
    dp = [[0 for _ in range(n + 1)] for _ in range(n + 1)]

    # base case
    dp[0][0] = 1

    # iterate over the length of the sequence
    for i in range(1, 2 * n + 1):
        # iterate over the sum of the first n bits
        for j in range(n + 1):
            # if the sum of the first n bits is less than the current index, then we can add a 0 to the sequence
            if j < i:
                dp[i][j] += dp[i - 1][j]
            # if the sum of the first n bits is equal to the current index, then we can add a 1 to the sequence
            if j == i:
                dp[i][j] += dp[i - 1][j - 1]

    # return the count of all binary sequences of length 2n such that sum of first n bits is same as sum of last n bits
    return dp[2 * n][n]

