def count_Rectangles(radius):
    """
    Counts the number of rectangles that can be inscribed in a circle of radius r.

    Args:
        radius (float): The radius of the circle.

    Returns:
        int: The number of rectangles that can be inscribed in the circle.
    """

    # Check if the radius is valid.
    if radius <= 0:
        raise ValueError("The radius must be a positive number.")

    # Calculate the number of rectangles.
    num_rectangles = 0
    for x in range(1, int(radius) + 1):
