def rearrange_bigger(n):
    # convert the number to a string
    n_str = str(n)

    # find the first digit that is smaller than its next digit
    i = len(n_str) - 2
    while i >= 0 and n_str[i] >= n_str[i + 1]:
        i -= 1

    # if no such digit is found, then the number is the largest possible rearrangement
    if i < 0:
        return n

    # find the smallest digit on the right side of the digit at index i that is greater than the digit at index i
    j = len(n_str) - 1
    while j >= 0 and n_str[j] <= n_str[i]:
        j -= 1

    # swap the digits at indices i and j
    n_str[i], n_str[j] = n_str[j], n_str[i]

    # reverse the digits on the right side of the digit at index i
    n_str[i + 1:] = n_str[i + 1:][::-1]

    # convert the string back to an integer
    return int(n_str)

