    dp = [[0 for x in range(n)] for x in range(m)]

    # fill the table in bottom-up manner
    for col in range(n - 1, -1, -1):
        for row in range(m):
            # if we are in the first column
            if col == n - 1:
                dp[row][col] = gold[row][col]
            # if we are not in the first column
            else:
                # find the maximum of the right, right-up, and right-down cells
                right = dp[row][col + 1]
                right_up = dp[row - 1][col + 1] if row > 0 else 0
                right_down = dp[row + 1][col + 1] if row < m - 1 else 0
                dp[row][col] = gold[row][col] + max(right, right_up, right_down)

    # find the maximum element in the first column of the table
    max_gold = 0
    for i in range(m):
        max_gold = max(max_gold, dp[i][0])

    # return the maximum gold collected
    return max_gold

